import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../css/Home.css';

const Home = () => {
    const navigate = useNavigate();

    // Fonction pour naviguer vers la page des appartements
    const handleAppartementsClick = () => {
        navigate('/appartements');
    };

    // Fonction pour naviguer vers la page des propriétaires
    const handleProprietairesClick = () => {
        navigate('/proprietaires'); // Navigation vers la page des propriétaires
    };

    return (
        <div>
            <div className="navbar">
                <div className="logo">LesRouchons.com</div>
                <div>
                    <a href="#" onClick={handleAppartementsClick}>Appartements</a> {/* Utilisation correcte de onClick */}
                    <a href="#" onClick={handleProprietairesClick}>Propriétaires</a> {/* Utilisation correcte de onClick */}
                    <a href="#accommodations">Accommodations</a>
                </div>
            </div>

            <div className="home-container">
                <h1 className="home-title">Trouvez un logement !</h1>
                <div className="location-card" onClick={handleAppartementsClick}>
                    <img src="url_de_l_image_montpellier" alt="Montpellier" />
                    <p>Montpellier</p>
                </div>
            </div>
        </div>
    );
};

export default Home;
